import React from 'react';
import styled from 'styled-components';

function Header() {
  return (
    <Section>
      <span>왕초닷컴</span>
      <p>로그인</p>
      <HeaderName>회원가입</HeaderName>
      <HeaderName>3조</HeaderName>
    </Section>
  )
}

export default Header

const Section = styled.section`
  margin: 15px 20px;
`;

const HeaderName = styled.span`
  float: right;
`
